  // Example data, you can replace this with dynamic data fetching
  const services = [
    {
      id: 1,
      title: 'שירותי קייטרינג - תל אביב',
      rating: 4.9,
      reviews: 159,
      image: '/cover-profile.webp',
    },
    {
      id: 2,
      title: 'שירותי צילום - ירושלים',
      rating: 4.8,
